import './App.css';
import ReactYoutube from './reactyoutube.js';
import { useEffect } from 'react';
import dotenv from 'dotenv';
dotenv.config();
const YOUTUBE_PLAYLIST_ITEMS = "https://www.googleapis.com/youtube/v3/playlistItems";

function App() {
  useEffect(()=>{
    (async()=>{
      const res = await fetch(`${YOUTUBE_PLAYLIST_ITEMS}?part=snipset&key=${PROCESS.env.GOOGLE_APIS_KEY}`);
      const data = await res.json();
      console.log(data);
    })();
    }, []);

  return (
    <div className="App">
      <ReactYoutube />
    </div>
  );
}

export default App;
